# Задача: 1. Для каждого упражнения написать программную реализацию.
# Код пишите в файлах с расширением .py в кодировке UTF-8 (в PyCharm работает по умолчанию). Каждую задачу необходимо сохранять в отдельный файл. Рекомендуем использовать английские имена, например, les_4_task_1, les_4_task_2, и т.д.
# Для оценки «Отлично» необходимо выполнить оба задания.
# Результаты анализа сохранить в виде комментариев в файле с кодом.
# Проанализировать скорость и сложность одного любого алгоритма из разработанных в рамках домашнего задания первых трех уроков.
# Примечание. Идеальным решением будет:
# ● выбрать хорошую задачу, которую имеет смысл оценивать,
# ● написать 3 варианта кода (один у вас уже есть),
# ● проанализировать 3 варианта и выбрать оптимальный,
# ● результаты анализа вставить в виде комментариев в файл с кодом (не забудьте указать, для каких N вы проводили замеры),
# ● написать общий вывод: какой из трёх вариантов лучше и почему.

# 4. Найти максимальный элемент среди минимальных элементов столбцов матрицы.

import timeit
import cProfile
import random


def les_3_task_9(SIZE):
    MIN_ITEM = 1
    MAX_ITEM = 100
    matrix = [[random.randint(MIN_ITEM, MAX_ITEM) for _ in range(SIZE)] for _ in range(SIZE)]

    max_of_min = float('-inf')
    for i in range(0, len(matrix[0])):
        num_min = matrix[0][i]
        for j in range(len(matrix)):
            if matrix[j][i] < num_min:
                num_min = matrix[j][i]
        if max_of_min < num_min:
            max_of_min = num_min
    return max_of_min

